export function getDate() {
  let d = new Date();
  let year = d.getFullYear();
  let month = d.getMonth();
  let day = d.getDay();

  //this takes off the extra characters of the ISO date so I can pass
  //it into my url as a parameter

  return `${year}-${month}-${day}`;
}
